import React from 'react';
import '../../css/UserList.css';

const UserList = () => {
  const users = [
    {
      id: '#0001',
      phone: '0987654321',
      name: 'Nguyễn Thanh Mính Lộc',
      accountType: 'Quản trị viên',
      lastLogin: '03/06/2025 09:42',
      status: 'inactive',
    },
    // ... các user khác
  ];

  return (
    <div className="user-management">
      <h2>Danh sách người dùng</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Số điện thoại</th>
            <th>Tên</th>
            <th>Loại tài khoản</th>
            <th>Lần đăng nhập cuối</th>
            <th>Trạng thái</th>
          </tr>
        </thead>
        <tbody>
          {users.map((user) => (
            <tr key={user.id}>
              <td>{user.id}</td>
              <td>{user.phone}</td>
              <td>{user.name}</td>
              <td>{user.accountType}</td>
              <td>{user.lastLogin}</td>
              <td>{user.status === 'active' ? 'Hoạt động' : 'Ngưng hoạt động'}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default UserList;
